INSERT INTO `races` VALUES (5,'Human',6,6,6,6,6,6,6,6,6,6,95,95,'80','80','100',0,0,0,'2010-07-12 23:55:21','2010-07-12 23:55:21',68,157,'The humans of Islands of Myth are the most common race, and also the more adaptable one. Though less gifted than other races in a specific guild, they are good learners, able to master skills and spells equally. They can be both fierce fighters and learned spellcasters.',NULL),(6,'Cromagnon',7,6,7,2,2,6,5,6,2,7,90,70,'68','84','106',0,0,0,'2010-07-13 00:15:24','2010-07-13 00:15:24',65,165,'Cromagnons are living relics from the early dawn of humanity. They are living ancestors of humans and are thought of as Humans by most. Actually, they are quite a bit different; Cromagnons lack the ability \r\nfor magic completely, but they possess a better grasp of basic skills and are a bit stronger because of their tougher lifestyle.',NULL);
